 var Menu={load:function(a,i,v){v=v?"navbar-"+v+" bg-"+v:"navbar-light bg-light",$.getJSON(a,function(a){var n=$('<nav class="navbar navbar-expand-lg navbar-light '+v+'">').prependTo(i);$('<a class="navbar-brand" href="#">'+a.title+"</a>").appendTo(n);var e=$('<button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarMain" aria-controls="navbarMain" aria-expanded="false" aria-label="Toggle navigation">').appendTo(n);$('<span class="navbar-toggler-icon">').appendTo(e);var r=$('<div class="collapse navbar-collapse" id="navbarMain">').appendTo(n),o=$('<ul class="navbar-nav mr-auto">').appendTo(r),l=a.data;for(var p in a.data)if("string"==typeof l[p]){var d=$('<li class="nav-item">').appendTo(o);$('<a class="nav-link" href="'+l[p]+'">'+p+"</a>").appendTo(d)}else{d=$('<li class="nav-item dropdown">').appendTo(o);$('<a class="nav-link dropdown-toggle" href="#" id="'+p+'" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">').appendTo(d).text(p);var t=$('<div class="dropdown-menu" aria-labelledby="'+p+'">').appendTo(d);for(var s in l[p])$('<a class="dropdown-item" href="'+l[p][s]+'">'+s+"</a>").appendTo(t)}})}};